"use client";

import { useMemo } from "react";
import { useQuery } from "@tanstack/react-query";
import { useAuth } from "@/hooks/useAuth";
import { Header } from "@/components/Header";
import { apiRequest } from "@/lib/queryClient";
import type { Flight } from "@shared/schema";
import airportsDataRaw from "@/airports.json";
import { motion } from "framer-motion";

interface AirportJSON {
  iata: string;
  icao: string;
  name: string;
  city: string;
  country: string;
  iso_country: string;
  latitude: number;
  longitude: number;
}

const airportsData: AirportJSON[] = airportsDataRaw as AirportJSON[];

interface Stamp {
  id: string;
  name: string;
  isoCode: string;
  travelDate?: string;
}

// Flag emoji helper
const getFlagEmoji = (countryCode: string) =>
  countryCode.toUpperCase().replace(/./g, (char) =>
    String.fromCodePoint(127397 + char.charCodeAt(0))
  );

const getCountryFromAirportCode = (code: string) => {
  const trimmed = code.trim();
  // Check both IATA (3-letter) and ICAO (4-letter) codes
  const airport = airportsData.find((a) => a.iata === trimmed || a.icao === trimmed);
  return airport?.iso_country || null;
};

export default function Achievements() {
  const { token } = useAuth();

  const { data: flights = [] } = useQuery<Flight[]>({
    queryKey: ["user-flights", token],
    enabled: !!token,
    queryFn: async () => {
      if (!token) return [];
      const res = await apiRequest("GET", "/api/flights", null, token);
      if (!res.ok) throw new Error("Failed to fetch flights");
      return res.json();
    },
  });

  const allStamps: Stamp[] = useMemo(() => {
    const countryVisits = new Map<string, string>();

    for (const f of flights) {
      const flightDate = f.date || f.departure_time?.split("T")[0];

      // Use airport code to get country (more reliable than lat/lon)
      if (f.arrival) {
        const c = getCountryFromAirportCode(f.arrival);
        if (c) {
          const code = c.toLowerCase();
          if (!countryVisits.has(code) || (flightDate && flightDate < (countryVisits.get(code) || ""))) {
            countryVisits.set(code, flightDate || "");
          }
        }
      }
    }

    return Array.from(countryVisits.entries()).map(([code, date], i) => ({
      id: `${i + 1}`,
      name: code.toUpperCase(),
      isoCode: code,
      travelDate: date,
    }));
  }, [flights]);

  // Random row pattern for floating capsules
  const rows: Stamp[][] = useMemo(() => {
    const result: Stamp[][] = [];
    const stamps = [...allStamps];
    const rowPattern = [3, 2, 5, 4, 6]; // variable row sizes
    let i = 0;
    while (stamps.length) {
      const count = rowPattern[i % rowPattern.length];
      result.push(stamps.splice(0, count));
      i++;
    }
    return result;
  }, [allStamps]);

  const getRotation = () => Math.random() * 8 - 4; // small rotation
  const getYOffset = () => Math.random() * 4 - 2;  // small vertical offset

  return (
  <>
    <Header />
    <div className="relative min-h-screen w-full bg-black text-white pt-24 pb-24 flex flex-col">
      {/* Green glow */}
      <div className="absolute top-0 left-1/2 -translate-x-1/2 w-[300px] h-[300px] sm:w-[400px] sm:h-[400px] bg-[#22c55e]/10 blur-[120px] rounded-full pointer-events-none" />

       {/* Title */}
        <motion.h1
          initial={{ opacity: 0, y: -20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.6 }}
          className="text-4xl md:text-5xl font-extrabold text-transparent bg-clip-text bg-gradient-to-r from-white to-[#22c55e] drop-shadow-[0_0_15px_rgba(34,197,94,0.4)] text-center mb-10 inline-block"
        >
          Achievements
        </motion.h1>



      {allStamps.length === 0 ? (
        <motion.p
          initial={{ opacity: 0 }}
          animate={{ opacity: 1 }}
          className="text-white/60 text-base sm:text-lg text-center mt-10 px-4"
        >
          No journeys yet — start exploring ✈️
        </motion.p>
      ) : (
        <div className="flex flex-col gap-3 sm:gap-4 w-full px-3 sm:px-6 md:px-8 lg:px-12">
          {rows.map((row, rowIndex) => (
            <motion.div
              key={rowIndex}
              className="flex justify-center gap-2 sm:gap-3 md:gap-4 lg:gap-5 flex-wrap"
            >
              {row.map((stamp) => (
                <motion.div
                  key={stamp.id}
                  initial={{ opacity: 0, y: 20 }}
                  animate={{
                    opacity: 1,
                    y: getYOffset(),
                    rotate: getRotation(),
                  }}
                  transition={{ duration: 0.5 }}
                  className="flex items-center gap-2 sm:gap-3 bg-white/5 backdrop-blur-sm border border-white/10 rounded-full px-3 py-2 sm:px-4 sm:py-2.5 md:px-5 md:py-3 hover:border-[#22c55e]/60 hover:shadow-[0_0_15px_rgba(34,197,94,0.25)] transition-all min-w-[120px] sm:min-w-[140px]"
                >
                  <span className="text-2xl sm:text-3xl">{getFlagEmoji(stamp.isoCode)}</span>
                  <div className="flex flex-col">
                    <span className="text-base sm:text-lg md:text-xl font-medium text-white tracking-wide">
                      {stamp.name}
                    </span>
                    <span className="text-xs sm:text-sm text-white/60">
                      {stamp.travelDate || "Unknown date"}
                    </span>
                  </div>
                </motion.div>
              ))}
            </motion.div>
          ))}
        </div>
      )}
    </div>
  </>
);
}

scripts/import-raw.ts.content:
import postgres from 'postgres';

const sourceDbUrl = process.env.SOURCE_DATABASE_URL!;
const destDbUrl = process.env.DATABASE_URL!;

async function importData() {
  console.log('🔗 Connecting to databases...');
  const source = postgres(sourceDbUrl);
  const dest = postgres(destDbUrl);

  try {
    // Import users
    console.log('\n📥 Importing users...');
    const users = await source`SELECT * FROM public.users`;
    if (users.length > 0) {
      for (const user of users) {
        await dest`
          INSERT INTO users (id, alien, username, email, password_hash, name, country, profile_image_url, is_admin, approved, invite_code_used, created_at, updated_at)
          VALUES (${user.id}, ${user.alien}, ${user.username}, ${user.email}, ${user.password_hash}, ${user.name}, ${user.country}, ${user.profile_image_url}, ${user.is_admin}, ${user.approved}, ${user.invite_code_used}, ${user.created_at}, ${user.updated_at})
          ON CONFLICT (id) DO NOTHING
        `;
      }
      console.log(`✅ Imported ${users.length} users`);
    }

    // Import invite codes
    console.log('\n📥 Importing invite codes...');
    const inviteCodes = await source`SELECT * FROM public.invite_codes`;
    if (inviteCodes.length > 0) {
      for (const code of inviteCodes) {
        await dest`
          INSERT INTO invite_codes (id, code, created_by, used_by, max_uses, current_uses, is_active, expires_at, created_at)
          VALUES (${code.id}, ${code.code}, ${code.created_by}, ${code.used_by}, ${code.max_uses}, ${code.current_uses}, ${code.is_active}, ${code.expires_at}, ${code.created_at})
          ON CONFLICT (id) DO NOTHING
        `;
      }
      console.log(`✅ Imported ${inviteCodes.length} invite codes`);
    }

    // Import airlines
    console.log('\n📥 Importing airlines...');
    const airlines = await source`SELECT * FROM public.airlines`;
    if (airlines.length > 0) {
      for (const airline of airlines) {
        await dest`
          INSERT INTO airlines (id, airline_code, airline_name, country, icao, iata)
          VALUES (${airline.id}, ${airline.airline_code}, ${airline.airline_name}, ${airline.country}, ${airline.icao}, ${airline.iata})
          ON CONFLICT (id) DO NOTHING
        `;
      }
      console.log(`✅ Imported ${airlines.length} airlines`);
    }

    // Import airports
    console.log('\n📥 Importing airports (this may take a while...)...');
    const airports = await source`SELECT * FROM public.airports`;
    if (airports.length > 0) {
      // Batch insert airports for efficiency
      console.log(`   Processing ${airports.length} airports in batches...`);
      const batchSize = 1000;
      for (let i = 0; i < airports.length; i += batchSize) {
        const batch = airports.slice(i, i + batchSize);
        for (const airport of batch) {
          await dest`
            INSERT INTO airports (id, ident, type, name, latitude, longitude, elevation_ft, continent, iso_country, iso_region, municipality, gps_code, iata, icao, local_code)
            VALUES (${airport.id}, ${airport.ident}, ${airport.type}, ${airport.name}, ${airport.latitude}, ${airport.longitude}, ${airport.elevation_ft}, ${airport.continent}, ${airport.iso_country}, ${airport.iso_region}, ${airport.municipality}, ${airport.gps_code}, ${airport.iata}, ${airport.icao}, ${airport.local_code})
            ON CONFLICT (id) DO NOTHING
          `;
        }
        console.log(`   Processed ${Math.min(i + batchSize, airports.length)}/${airports.length} airports`);
      }
      console.log(`✅ Imported ${airports.length} airports`);
    }

    // Import flights
    console.log('\n📥 Importing flights...');
    const flights = await source`SELECT * FROM public.flights`;
    if (flights.length > 0) {
      for (const flight of flights) {
        await dest`
          INSERT INTO flights (id, user_id, airline_name, airline_code, flight_number, departure, arrival, departure_latitude, departure_longitude, arrival_latitude, arrival_longitude, departure_time, arrival_time, date, departure_terminal, arrival_terminal, aircraft_type, distance, duration, status, created_at)
          VALUES (${flight.id}, ${flight.user_id}, ${flight.airline_name}, ${flight.airline_code}, ${flight.flight_number}, ${flight.departure}, ${flight.arrival}, ${flight.departure_latitude}, ${flight.departure_longitude}, ${flight.arrival_latitude}, ${flight.arrival_longitude}, ${flight.departure_time}, ${flight.arrival_time}, ${flight.date}, ${flight.departure_terminal}, ${flight.arrival_terminal}, ${flight.aircraft_type}, ${flight.distance}, ${flight.duration}, ${flight.status}, ${flight.created_at})
          ON CONFLICT (id) DO NOTHING
        `;
      }
      console.log(`✅ Imported ${flights.length} flights`);
    }

    // Import stay-ins
    console.log('\n📥 Importing stay-ins...');
    const stayins = await source`SELECT * FROM public.stayins`;
    if (stayins.length > 0) {
      for (const stayin of stayins) {
        await dest`
          INSERT INTO stayins (id, user_id, check_in, check_out, country, city, name, maps_pin, type, created_at)
          VALUES (${stayin.id}, ${stayin.user_id}, ${stayin.check_in}, ${stayin.check_out}, ${stayin.country}, ${stayin.city}, ${stayin.name}, ${stayin.maps_pin}, ${stayin.type}, ${stayin.created_at})
          ON CONFLICT (id) DO NOTHING
        `;
      }
      console.log(`✅ Imported ${stayins.length} stay-ins`);
    }

    console.log('\n🎉 Data import completed successfully!');

    // Show summary
    console.log('\n📊 Import Summary:');
    const userCount = await dest`SELECT COUNT(*) as count FROM users`;
    const flightCount = await dest`SELECT COUNT(*) as count FROM flights`;
    const stayinCount = await dest`SELECT COUNT(*) as count FROM stayins`;
    const airlineCount = await dest`SELECT COUNT(*) as count FROM airlines`;
    const airportCount = await dest`SELECT COUNT(*) as count FROM airports`;

    console.log(`   Users: ${userCount[0].count}`);
    console.log(`   Flights: ${flightCount[0].count}`);
    console.log(`   Stay-ins: ${stayinCount[0].count}`);
    console.log(`   Airlines: ${airlineCount[0].count}`);
    console.log(`   Airports: ${airportCount[0].count}`);

  } catch (error) {
    console.error('❌ Error importing data:', error);
    throw error;
  } finally {
    await source.end();
    await dest.end();
  }
}

importData();

scripts/check-schema.ts.content:
import postgres from 'postgres';

const sourceDbUrl = process.env.NEON_DATABASE_URL || process.env.DATABASE_URL;

if (!sourceDbUrl) {
  throw new Error('DATABASE_URL or NEON_DATABASE_URL environment variable is required');
}

async function checkSchema() {
  const client = postgres(sourceDbUrl);

  try {
    console.log('🔍 Checking all schemas and tables...');
    const tables = await client`
      SELECT 
        table_schema, 
        table_name,
        table_type
      FROM information_schema.tables 
      WHERE table_type = 'BASE TABLE'
      ORDER BY table_schema, table_name
    `;

    console.log(`\nFound ${tables.length} tables across all schemas:`);
    tables.forEach((table: any) => {
      console.log(`  ${table.table_schema}.${table.table_name} (${table.table_type})`);
    });

    // Try to count rows in the first few tables
    console.log('\n📊 Attempting to count rows in first few tables:');
    for (const table of tables.slice(0, 10)) {
      const schemaName = table.table_schema;
      const tableName = table.table_name;
      try {
        const count = await client.unsafe(`SELECT COUNT(*) as count FROM "${schemaName}"."${tableName}"`);
        if (count[0].count > 0) {
          console.log(`  ✅ ${schemaName}.${tableName}: ${count[0].count} rows`);
        }
      } catch (error: any) {
        console.log(`  ⚠️  ${schemaName}.${tableName}: ${error.message}`);
      }
    }

  } catch (error) {
    console.error('❌ Error:', error);
  } finally {
    await client.end();
  }
}

checkSchema();

