import { useState } from "react";
import { useForm } from "react-hook-form";
import { zodResolver } from "@hookform/resolvers/zod";
import { useMutation } from "@tanstack/react-query";
import { motion } from "framer-motion";
import { z } from "zod";
import {
  User as UserIcon,
  Mail,
  MapPin,
  Key,
  LogOut,
  FileText,
  Shield,
  Send,
  ExternalLink,
} from "lucide-react";
import { useLocation } from "wouter";

import { Button } from "@/components/ui/button";
import { Input } from "@/components/ui/input";
import { useToast } from "@/hooks/use-toast";
import { useAuth } from "@/hooks/useAuth";
import { apiRequest, queryClient } from "@/lib/queryClient";
import { Header } from "@/components/Header";

const countries = [
  "Argentina", "Australia", "Austria", "Belgium", "Brazil", "Canada", "China",
  "Denmark", "Egypt", "Finland", "France", "Germany", "Greece", "Hungary",
  "Iceland", "India", "Indonesia", "Ireland", "Israel", "Italy", "Japan",
  "Kenya", "Luxembourg", "Malaysia", "Mexico", "Morocco", "Netherlands",
  "New Zealand", "Nigeria", "Norway", "Pakistan", "Peru", "Philippines",
  "Poland", "Portugal", "Qatar", "Romania", "Russia", "Saudi Arabia",
  "Singapore", "South Africa", "South Korea", "Spain", "Sweden", "Switzerland",
  "Thailand", "Turkey", "UAE", "UK", "USA", "Vietnam"
].sort();

const updateProfileSchema = z.object({
  name: z.string().min(2, "Name must be at least 2 characters"),
  username: z
    .string()
    .min(3, "Username must be at least 3 characters")
    .regex(/^[a-zA-Z0-9_]+$/, "Username can only contain letters, numbers, and underscores"),
  email: z.string().email("Invalid email address"),
  country: z.string(),
});

const changePasswordSchema = z.object({
  currentPassword: z.string().min(6, "Password must be at least 6 characters"),
  newPassword: z.string().min(6, "Password must be at least 6 characters"),
  confirmPassword: z.string().min(6, "Password must be at least 6 characters"),
}).refine((data) => data.newPassword === data.confirmPassword, {
  message: "Passwords don't match",
  path: ["confirmPassword"],
});

const contactFormSchema = z.object({
  subject: z.string().min(3, "Subject is required"),
  message: z.string().min(10, "Message must be at least 10 characters"),
});

type UpdateProfileForm = z.infer<typeof updateProfileSchema>;
type ChangePasswordForm = z.infer<typeof changePasswordSchema>;
type ContactForm = z.infer<typeof contactFormSchema>;

export default function Account() {
  const { user, logout } = useAuth();
  const { toast } = useToast();
  const [, navigate] = useLocation();
  const [activeSection, setActiveSection] = useState<"profile" | "password" | "support">("profile");

  const profileForm = useForm<UpdateProfileForm>({
    resolver: zodResolver(updateProfileSchema),
    defaultValues: {
      name: user?.name || "",
      username: user?.username || "",
      email: user?.email || "",
      country: user?.country || "Other",
    },
  });

  const passwordForm = useForm<ChangePasswordForm>({
    resolver: zodResolver(changePasswordSchema),
    defaultValues: {
      currentPassword: "",
      newPassword: "",
      confirmPassword: "",
    },
  });

  const contactForm = useForm<ContactForm>({
    resolver: zodResolver(contactFormSchema),
    defaultValues: {
      subject: "",
      message: "",
    },
  });

  const updateProfileMutation = useMutation({
    mutationFn: async (data: UpdateProfileForm) => {
      const res = await apiRequest("PATCH", "/api/auth/profile", data);
      if (!res.ok) {
        const error = await res.json();
        throw new Error(error.message || "Failed to update profile");
      }
      return res.json();
    },
    onSuccess: () => {
      queryClient.invalidateQueries({ queryKey: ["/api/auth/user"] });
      toast({
        title: "Profile updated ✅",
        description: "Your profile has been updated successfully.",
      });
    },
    onError: (err: any) => {
      toast({
        title: "Update failed",
        description: err.message,
        variant: "destructive",
      });
    },
  });

  const changePasswordMutation = useMutation({
    mutationFn: async (data: ChangePasswordForm) => {
      const res = await apiRequest("PATCH", "/api/auth/password", {
        currentPassword: data.currentPassword,
        newPassword: data.newPassword,
      });
      if (!res.ok) {
        const error = await res.json();
        throw new Error(error.message || "Failed to change password");
      }
      return res.json();
    },
    onSuccess: () => {
      passwordForm.reset();
      toast({
        title: "Password changed ✅",
        description: "Your password has been changed successfully.",
      });
    },
    onError: (err: any) => {
      toast({
        title: "Password change failed",
        description: err.message,
        variant: "destructive",
      });
    },
  });

  const sendSupportMessageMutation = useMutation({
    mutationFn: async (data: ContactForm) => {
      const res = await fetch("/api/contact", {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify({
          name: user?.name || "User",
          email: user?.email || "",
          subject: data.subject,
          message: data.message,
        }),
      });
      if (!res.ok) throw new Error("Failed to send message");
      return res.json();
    },
    onSuccess: () => {
      contactForm.reset();
      toast({
        title: "Message sent ✅",
        description: "Your message has been sent. We'll get back to you soon!",
      });
    },
    onError: () => {
      toast({
        title: "Failed to send message",
        description: "Please try again later.",
        variant: "destructive",
      });
    },
  });

  const handleLogout = () => {
    logout();
    toast({
      title: "Logged out",
      description: "See you next time! 👋",
    });
  };

  return (
    <div className="min-h-screen w-full bg-black text-white flex flex-col relative px-4 md:px-14 pb-16 pt-1 overflow-x-hidden">
      <Header />

      <div className="w-full bg-black text-white flex flex-col pt-24 pb-12 overflow-x-hidden">
        {/* Title */}
        <motion.h1
          initial={{ opacity: 0, y: -20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.6 }}
          className="text-4xl md:text-5xl font-extrabold text-transparent bg-clip-text bg-gradient-to-r from-white to-[#22c55e] drop-shadow-[0_0_15px_rgba(34,197,94,0.4)] text-center mb-8"
        >
          Account Settings
        </motion.h1>

        {/* User Info Card */}
        <div className="bg-gradient-to-br from-green-500/10 to-emerald-600/10 border border-green-500/30 rounded-xl p-6 mb-8 max-w-4xl mx-auto w-full">
          <div className="flex items-center gap-4">
            <div className="h-16 w-16 rounded-full bg-green-500/20 flex items-center justify-center">
              <UserIcon className="h-8 w-8 text-green-400" />
            </div>
            <div>
              <h2 className="text-xl font-semibold text-white">{user?.name}</h2>
              <p className="text-green-400">@{user?.username} · Alien #{user?.alien}</p>
              <p className="text-sm text-gray-400">{user?.email}</p>
            </div>
          </div>
        </div>

        {/* Section Tabs */}
        <div className="w-full overflow-x-auto scrollbar-hide mb-2">
          <div className="flex gap-7 py-4">
            <button
              onClick={() => setActiveSection("profile")}
              className={`px-4 py-2 transition-all whitespace-nowrap text-sm ${
                activeSection === "profile"
                  ? "bg-green-500 text-black rounded-full font-semibold"
                  : "text-gray-400 hover:text-white rounded-full"
              }`}
            >
              <div className="flex items-center gap-2">
                <UserIcon size={16} />
                Profile
              </div>
            </button>
            <button
              onClick={() => setActiveSection("password")}
              className={`px-4 py-2 transition-all whitespace-nowrap text-sm ${
                activeSection === "password"
                  ? "bg-green-500 text-black rounded-full font-semibold"
                  : "text-gray-400 hover:text-white rounded-full"
              }`}
            >
              <div className="flex items-center gap-2">
                <Key size={16} />
                Security
              </div>
            </button>
            <button
              onClick={() => setActiveSection("support")}
              className={`px-4 py-2 transition-all whitespace-nowrap text-sm ${
                activeSection === "support"
                  ? "bg-green-500 text-black rounded-full font-semibold"
                  : "text-gray-400 hover:text-white rounded-full"
              }`}
            >
              <div className="flex items-center gap-2">
                <Mail size={16} />
                Support
              </div>
            </button>
          </div>
        </div>

        <div className="border-b border-gray-600/40 my-6" />

        {/* Profile Section */}
        {activeSection === "profile" && (
          <motion.div
            initial={{ opacity: 0, x: -20 }}
            animate={{ opacity: 1, x: 0 }}
            className="space-y-6 max-w-4xl mx-auto w-full"
          >
            <div className="bg-neutral-900 border border-gray-700 rounded-xl p-6">
              <h3 className="text-lg font-semibold mb-4 text-white">Edit Profile</h3>
              <form
                onSubmit={profileForm.handleSubmit((data) =>
                  updateProfileMutation.mutate(data)
                )}
                className="space-y-4"
              >
                <div>
                  <label className="text-sm text-gray-400 mb-2 block">Full Name</label>
                  <Input
                    {...profileForm.register("name")}
                    className="bg-black border-gray-700 text-white"
                  />
                  {profileForm.formState.errors.name && (
                    <p className="text-sm text-red-400 mt-1">
                      {profileForm.formState.errors.name.message}
                    </p>
                  )}
                </div>

                <div>
                  <label className="text-sm text-gray-400 mb-2 block">Username</label>
                  <Input
                    {...profileForm.register("username")}
                    className="bg-black border-gray-700 text-white"
                  />
                  {profileForm.formState.errors.username && (
                    <p className="text-sm text-red-400 mt-1">
                      {profileForm.formState.errors.username.message}
                    </p>
                  )}
                </div>

                <div>
                  <label className="text-sm text-gray-400 mb-2 block">Email</label>
                  <Input
                    {...profileForm.register("email")}
                    type="email"
                    className="bg-black border-gray-700 text-white"
                  />
                  {profileForm.formState.errors.email && (
                    <p className="text-sm text-red-400 mt-1">
                      {profileForm.formState.errors.email.message}
                    </p>
                  )}
                </div>

                <div>
                  <label className="text-sm text-gray-400 mb-2 block">Country</label>
                  <select
                    {...profileForm.register("country")}
                    className="w-full h-10 bg-black border border-gray-700 text-white rounded-md px-3"
                  >
                    {countries.map((c) => (
                      <option key={c} value={c}>
                        {c}
                      </option>
                    ))}
                  </select>
                </div>

                <Button
                  type="submit"
                  disabled={updateProfileMutation.isPending}
                  className="w-full h-12 bg-gradient-to-r from-green-500 to-emerald-600 text-black font-semibold rounded-full hover:shadow-[0_0_30px_rgba(34,197,94,0.4)] transition-all disabled:opacity-50"
                >
                  {updateProfileMutation.isPending ? "Saving..." : "Save Changes"}
                </Button>
              </form>
            </div>
          </motion.div>
        )}

        {/* Password Section */}
        {activeSection === "password" && (
          <motion.div
            initial={{ opacity: 0, x: -20 }}
            animate={{ opacity: 1, x: 0 }}
            className="space-y-6 max-w-4xl mx-auto w-full"
          >
              <div className="bg-neutral-900 border border-gray-700 rounded-xl p-6">
                <h3 className="text-lg font-semibold mb-4 text-white">Change Password</h3>
                <form
                  onSubmit={passwordForm.handleSubmit((data) =>
                    changePasswordMutation.mutate(data)
                  )}
                  className="space-y-4"
                >
                  <div>
                    <label className="text-sm text-gray-400 mb-2 block">Current Password</label>
                    <Input
                      {...passwordForm.register("currentPassword")}
                      type="password"
                      className="bg-black border-gray-700 text-white"
                    />
                    {passwordForm.formState.errors.currentPassword && (
                      <p className="text-sm text-red-400 mt-1">
                        {passwordForm.formState.errors.currentPassword.message}
                      </p>
                    )}
                  </div>

                  <div>
                    <label className="text-sm text-gray-400 mb-2 block">New Password</label>
                    <Input
                      {...passwordForm.register("newPassword")}
                      type="password"
                      className="bg-black border-gray-700 text-white"
                    />
                    {passwordForm.formState.errors.newPassword && (
                      <p className="text-sm text-red-400 mt-1">
                        {passwordForm.formState.errors.newPassword.message}
                      </p>
                    )}
                  </div>

                  <div>
                    <label className="text-sm text-gray-400 mb-2 block">Confirm New Password</label>
                    <Input
                      {...passwordForm.register("confirmPassword")}
                      type="password"
                      className="bg-black border-gray-700 text-white"
                    />
                    {passwordForm.formState.errors.confirmPassword && (
                      <p className="text-sm text-red-400 mt-1">
                        {passwordForm.formState.errors.confirmPassword.message}
                      </p>
                    )}
                  </div>

                  <Button
                    type="submit"
                    disabled={changePasswordMutation.isPending}
                    className="w-full h-12 bg-gradient-to-r from-green-500 to-emerald-600 text-black font-semibold rounded-full hover:shadow-[0_0_30px_rgba(34,197,94,0.4)] transition-all disabled:opacity-50"
                  >
                    {changePasswordMutation.isPending ? "Changing..." : "Change Password"}
                  </Button>
                </form>
              </div>
            </motion.div>
          )}

        {/* Support Section */}
        {activeSection === "support" && (
          <motion.div
            initial={{ opacity: 0, x: -20 }}
            animate={{ opacity: 1, x: 0 }}
            className="space-y-6 max-w-4xl mx-auto w-full"
          >
              {/* Support Form */}
              <div className="bg-neutral-900 border border-gray-700 rounded-xl p-6">
                <h3 className="text-lg font-semibold mb-4 text-white">Contact Support</h3>
                <form
                  onSubmit={contactForm.handleSubmit((data) =>
                    sendSupportMessageMutation.mutate(data)
                  )}
                  className="space-y-4"
                >
                  <div>
                    <label className="text-sm text-gray-400 mb-2 block">Subject</label>
                    <Input
                      {...contactForm.register("subject")}
                      placeholder="Brief description of your issue"
                      className="bg-black border-gray-700 text-white"
                    />
                    {contactForm.formState.errors.subject && (
                      <p className="text-sm text-red-400 mt-1">
                        {contactForm.formState.errors.subject.message}
                      </p>
                    )}
                  </div>

                  <div>
                    <label className="text-sm text-gray-400 mb-2 block">Message</label>
                    <textarea
                      {...contactForm.register("message")}
                      placeholder="Describe your issue in detail..."
                      rows={5}
                      className="w-full bg-black border border-gray-700 text-white rounded-md px-3 py-2 resize-none"
                    />
                    {contactForm.formState.errors.message && (
                      <p className="text-sm text-red-400 mt-1">
                        {contactForm.formState.errors.message.message}
                      </p>
                    )}
                  </div>

                  <Button
                    type="submit"
                    disabled={sendSupportMessageMutation.isPending}
                    className="w-full h-12 bg-gradient-to-r from-green-500 to-emerald-600 text-black font-semibold rounded-full hover:shadow-[0_0_30px_rgba(34,197,94,0.4)] transition-all disabled:opacity-50"
                  >
                    <Send className="h-4 w-4 mr-2" />
                    {sendSupportMessageMutation.isPending ? "Sending..." : "Send Message"}
                  </Button>
                </form>
              </div>

              {/* Quick Links */}
              <div className="bg-neutral-900 border border-gray-700 rounded-xl p-6">
                <h3 className="text-lg font-semibold mb-4 text-white">Resources</h3>
                <div className="space-y-3">
                  <button
                    onClick={() => navigate("/privacy")}
                    className="w-full flex items-center justify-between p-3 bg-black hover:bg-white/5 border border-gray-700 rounded-lg transition-colors"
                  >
                    <div className="flex items-center gap-3">
                      <Shield className="h-5 w-5 text-green-400" />
                      <span className="text-white">Privacy Policy</span>
                    </div>
                    <ExternalLink className="h-4 w-4 text-gray-400" />
                  </button>

                  <button
                    onClick={() => navigate("/terms")}
                    className="w-full flex items-center justify-between p-3 bg-black hover:bg-white/5 border border-gray-700 rounded-lg transition-colors"
                  >
                    <div className="flex items-center gap-3">
                      <FileText className="h-5 w-5 text-green-400" />
                      <span className="text-white">Terms of Service</span>
                    </div>
                    <ExternalLink className="h-4 w-4 text-gray-400" />
                  </button>
                </div>
              </div>
            </motion.div>
          )}

        {/* Logout Button */}
        <div className="mt-8 max-w-4xl mx-auto w-full">
          <Button
            onClick={handleLogout}
            className="w-full h-12 bg-gradient-to-r from-red-500 to-red-600 text-white font-semibold rounded-full hover:shadow-[0_0_30px_rgba(239,68,68,0.4)] transition-all"
          >
            <LogOut className="h-4 w-4 mr-2" />
            Log Out
          </Button>
        </div>
      </div>
    </div>
  );
}
